import React from 'react';
import { useAlert } from 'react-alert'


function Reset() {
	const alert = useAlert()

	const handleClickEvent = () => {
		alert.show("test reset click");
	};

	return (
    <div>
      <button onclick={handleClickEvent}>
      	Reset Turtle
      </button>
    </div>
  );
}


export default Reset;

